import React from 'react';

const Contact = () => {
  return (
    <div id='contact' className='component'>
      <h1>CONTACT ME</h1>

      <div>
        <h2>Connect on Social</h2>
        <img></img>
      </div>
      <p>Insert Linkedin, Github icons here</p>
    </div>
  )
}

export default Contact
